import { Navigate, useParams } from "react-router-dom";

import "./Item.css";

const Item = ({items}) => {
  let {itemIdStr} = useParams();
  const itemId = parseInt(itemIdStr);
  const findItem = (id) => {
    return items.find((item) => item.id === id);
  };
  console.log()
  return (    
    <div>
      <h1>{findItem(itemId)}</h1>
    </div>
  );
};

export default Item;
